import React, { useState } from "react";
import Home from "./Home/Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom"

function App() {
  const [IdPasajeroActual,setIdPasajeroActual]=useState(0)
  const CambiarIdPasajero =(item)=>{
    setIdPasajeroActual(item)
  }

  return (
    <div className="App">
      <header className="App-header">
      <Router>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/Pasajeros/BusquedaPasajeros" element={<BusquedaPasajero CambiarIdPasajero={CambiarIdPasajero} />} />
            <Route path="/Pasajeros/DetallePasajero" element={<DetallePasajero IdPasajeroActual={IdPasajeroActual} />} />
          </Routes>
        </Router>
      </header>
    </div>
  );
}

export default App;
